import React from "react";
import UnitCard from "./UnitCard";

const listings = ({ listings }) => {
  const getListings = () => {
    let listingsOnPage = [];
    let result = [];
    console.log(listings);

    listings.map((unit) => {
      return listingsOnPage.push(
        <UnitCard
          id={units.unit.num_of_bedrooms}
          num_of_bedrooms={units.unit.num_of_bedrooms}
          num_of_bathrooms={units.unit.num_of_bathrooms}
          num_of_balcony={units.unit.num_of_balcony}
          is_available={units.unit.is_available}
          is_reserved={units.unit.is_reserved}
          unit_availability_start_date={units.unit.unit_availability_start_date}
          unit_availability_end_date={units.unit.unit_availability_end_date}
          unit_description={units.unit.unit_description}
          living_area_sf={units.unit.living_area_sf}
          unit_number={units.unit.unit_number}
          unit_at_floor={units.unit.unit_at_floor}
        />
      );
    });

    for (let i = 0; i < listings.length; i += 3) {
      result.push(
        <div className="row">
          <div className="col-1-of-3">{listingsOnPage[i]}</div>
          <div className="col-1-of-3">
            {listingsOnPage[i + 1] ? listingsOnPage[i + 1] : null}
          </div>
          <div className="col-1-of-3">
            {listingsOnPage[i + 2] ? listingsOnPage[i + 2] : null}
          </div>
        </div>
      );
    }

    return result;
  };

  return <div>{getListings()}</div>;
};

export default listings;
